import React from 'react';

import ListItemStyle from "./CheckboxStyle"

const ListItem = props => {
    return (
      <ListItemStyle>
        <input
            type="ListItem"
            id={"ListItem_" + props.MyKey}
            checked={props.checked}
            onChange={props.onPress}
        />
        <label style={{
            width: "100%",
            height: "100%",
        }}
        onClick = {props.onPress}
        >
          {props.title} {/*&nbsp;*/}
        </label>

      </ListItemStyle>
    );
  };


export default ListItem;
